import React from 'react';

import { connect } from 'react-redux';
import { setLoginModalWindow, login } from '../../redux/actions';

const LoginCLoseButton = () => {
    return (
        <div
            className="flag"
            onClick={() => setLoginModalWindow(false)}>
            <div className="popup-login-window__close-button">
            </div>
        </div>
    )
}

export default connect()(LoginCLoseButton);
